function cobertura(){
    var formulario  = $('#cobertura'),
        sombra      = $('#ocultarCobertura'),
        disparador  = $('.mostrarFormularioCobertura');

    disparador.on('click', function(e){
        e.preventDefault();
        $('body').addClass('overhidden');
        formulario.addClass('abierto');
    });
    
    sombra.on('click',function(e){ 
        e.preventDefault();
        formulario.css({
            'transform' : 'translate3d(0, -100%, 0)',
            '-webkit-transform' : 'translate3d(0, -100%, 0)'
        });
        setTimeout(function(){
            $('body').removeClass('overhidden');
            formulario.removeClass('abierto');
            formulario.removeAttr('style');
        }, 200);
    });
}

