/*
*   Revisin y asignacin de cobertura
*********************************/
function coverage(data){

    var testingMode = true,
        c = {log : function(s){ if(testingMode) console.log(s) }},

        kmlsrc = '/resources/CoberturaEnlace.kml',  // Ubicacin del kml
        inputCP,
        inputCobertura,
        inputLatitud,
        inputLongitud,
        valorGclid,
        valCP,
        codigoPostalDefault = '11520',
        valCol = '',
        recordType,

        latitudCob = 0,
        longitudCob = 0,

        domicilio,
        kmlParsed,
        arrPoligonos = new Array(),

        tituloConCobertura = "S te encuentras dentro de nuestra cobertura!",
        mensajeConCobertura = "Estamos enviado tu informacin. Nos pondremos en contacto contigo.",
        tituloSinCobertura = "Muchas gracias",
        mensajeSinCobertura = "Daremos seguimiento a tu solicitud y sta ser atendida en breve por uno de nuestros agentes",
        modalCobertura = $('#mensajeCobertura'),
        h4modalcobertura = $('#mensajeCobertura h4'),
        pmodalcobertura = $('#mensajeCobertura p'),
        tiempoModalAviso = 3000;

    // Asignamos valores a los inputs segn el campo de procedencia
    switch (data.origen) {
        case '3': // Formulario de contacto
            c.log('Venimos del formulario de contacto');
            inputCP = $('#c3cp');
            inputCobertura = $('#c3coberturainput');
            inputLatitud = $('#c3latitudCoordenada');
            inputLongitud = $('#c3longitudCoordenada');
            recordType = $('#CobSec3');
            // Si el campo de gclid est vacio pero hay un localstorage
            if(localStorage.getItem("enlacegclid") && $('#c3gclid').val()==''){
                c.log('Se asigna valor al gclid');
                valorGclid = localStorage.getItem("enlacegclid");
                $('#c3gclid').val(valorGclid);
            }
            break;
            
        case '1': // Nosotros te llamamos
            c.log('Venimos del formulario de cobertura');
            inputCP = $('#c2cp');
            inputCobertura = $('#c2coberturainput');
            inputLatitud = $('#c2latitudCoordenada');
            inputLongitud = $('#c2longitudCoordenada');
            recordType = $('#CobSec1');
            // Si el campo de gclid est vacio pero hay un localstorage
            if(localStorage.getItem("enlacegclid") && $('#c2gclid').val()==''){
                c.log('Se asigna valor al gclid');
                valorGclid = localStorage.getItem("enlacegclid");
                $('#c2gclid').val(valorGclid);
            }
            break;

        case '4': // Nosotros te llamamos footer
            c.log('Venimos del formulario de cobertura');
            inputCP = $('#c2cpfooter');
            inputCobertura = $('#c2coberturainputfooter');
            inputLatitud = $('#c2latitudCoordenadafooter');
            inputLongitud = $('#c2longitudCoordenadafooter');
            recordType = $('#CobSec1footer');
            // Si el campo de gclid est vacio pero hay un localstorage
            if(localStorage.getItem("enlacegclid") && $('#c2gclidfooter').val()==''){
                c.log('Se asigna valor al gclid');
                valorGclid = localStorage.getItem("enlacegclid");
                $('#c2gclidfooter').val(valorGclid);
            }
            break;
            
        default: // Verifica cobertura
            c.log('Venimos del formulario de llamada');
            inputCP = $('#cp');
            inputCobertura = $('#coberturainput');
            inputLatitud = $('#latitudCoordenada');
            inputLongitud = $('#longitudCoordenada');
            recordType = $('#CobSec2');
            // Si el campo de gclid est vacio pero hay un localstorage
            if(localStorage.getItem("enlacegclid") && $('#gclid').val()==''){
                c.log('Se asigna valor al gclid');
                valorGclid = localStorage.getItem("enlacegclid");
                $('#gclid').val(valorGclid);
            }
            break;
    }

    c.log('Entramos al coverage');
    c.log('El form:');
    c.log(data.form);
    


    // Asignamos valores a las variables para buscar coordenada
    valCP = inputCP.val().length == 0 ? codigoPostalDefault : inputCP.val();
    c.log('Direccin a buscar: ' + valCol +' '+ valCP);

    // Creamos mapa y parseamos el kml
    function useTheData2(doc){
        // Geodata handling goes here, using JSON properties of the doc object
        for (var i = 0; i < doc[0].placemarks.length; i++)
        {
            if(doc[0].placemarks[i].Polygon != undefined && doc[0].placemarks[i].Polygon != null)
            {
                //console.log(doc[0].placemarks[i].name);
                var coordenadas = doc[0].placemarks[i].Polygon[0].outerBoundaryIs[0].coordinates;
                var coordenadapoligono = [];
                for(var x=0; x < coordenadas.length; x++)
                {
                    var coordenada = new Object();
                    coordenada.lat = coordenadas[x].lat;
                    coordenada.lng = coordenadas[x].lng;
                    
                    coordenadapoligono.push(coordenada);
                }
                        
                var poligono = new google.maps.Polygon({path: coordenadapoligono});
                arrPoligonos.push(poligono);
                //var status = google.maps.geometry.poly.containsLocation(new google.maps.LatLng(19.424280, -99.213535) , poligono);
            }
        }
    }
    domicilio = new google.maps.Geocoder();
    kmlParsed = geoXML3.parser({afterParse: useTheData2});
    kmlParsed.parse(kmlsrc);

    function actualizaStatus2(){
        var status = false;
        for(i=0; i<arrPoligonos.length; i++){
            status = google.maps.geometry.poly.containsLocation(new google.maps.LatLng(Number(latitudCob) , Number(longitudCob)) , arrPoligonos[i]);
            if(status){
               break;
            }        
        }

        // Se disparan acciones si est o no en cobertura
        c.log("encontr cobertura en "+latitudCob +","+ longitudCob +" ? : "+status);
        
        if(status) {
            recordType.val('01261000000ks49');
            h4modalcobertura.empty().text(tituloConCobertura);
            pmodalcobertura.empty().text(mensajeConCobertura);
        } else {
            recordType.val('01261000000ks4E');
            h4modalcobertura.empty().text(tituloSinCobertura);
            pmodalcobertura.empty().text(mensajeSinCobertura);
        }
        inputCobertura.val(status);

        modalCobertura.modal('open');
        setTimeout( function(){

            // Si tenemos el valor de gclid lo borramos aqu
            if(localStorage.getItem("enlacegclid")) localStorage.removeItem("enlacegclid");

            // Cerramos el aviso
            modalCobertura.modal('close');

            // Se manda el formulario
            data.form.submit(); 
            
        }, tiempoModalAviso);
    


    }

    // Si hay domicilio
    if(domicilio){
        domicilio.geocode({ 
            address: valCol, 
            componentRestrictions:{
                'country':'MX',
                'postalCode': valCP
            }, 
            language: 'es'
        }, function(results, status) {
            if (status == google.maps.GeocoderStatus.OK) {
                latitudCob=results[0].geometry.location.lat();
                longitudCob=results[0].geometry.location.lng();
                c.log('Coordenada encontrada:');
                c.log(latitudCob +','+ longitudCob);

                // Se pintan los valores dentro de las coordenadas
                inputLatitud.val(latitudCob);
                inputLongitud.val(longitudCob);

                actualizaStatus2();
                    
            } else {
                c.log("Geocode was not successful for the following reason: " + status);   
            }
        });

    } else {
        c.log('No se gener el objeto domicilio');
        c.log(domicilio)
    }
        


}


