function activeMenu(){
    //Tomamos el path de la url
    var url = window.location.pathname;

    //Recorremos todos los enlaces del menu
    $('header ul li').each(function () {
        //tomamos el texto y lo adaptamos como queremos
        var enlace = "/" + $(this).children('a').text().toLowerCase().replace(' ', '-').replace(' ', '-');

        //Hacemos un pequeo ajuste para buscar la url que necesitamos
        if(enlace == "/empresa-en-crecimiento"){
            enlace = "/empresas-crecimiento"
        }

        if(enlace == "/soluciones-por-sector"){
            enlace = "/soluciones-sector"
        }

        //Buscamos que el enlace existe en la url
        var encontrando = url.indexOf(enlace);

        //De ser asi agregamos la clase active
        if (encontrando == "0") {
            $(this).children('a').addClass('active');
        }
    });
}





/**
 * Muestra el formulario de llamada abierto
 *
 * @param array Arreglo de secciones (url amigables) donde debe ocultarse
 */
function clicToCallShow(a){
    var test = 0,
        arreglo = a,
        i = 0,
        l = 0,
        ancho = $(window).width(),
        posicion = window.location.pathname.replace(/\.(html|jsp)/g,''),
        boton = $('#showForm.clicktocallDesktop'),
        formulario = $('#formulariollamada'),
        contenedorForm = $('#containerFormCall'),
        c = {log : function(s){ if(test) console.log(s) }};

    c.log(' --- Iniciamos la funcin clicToCallShow --- ');

    if(!Array.isArray(arreglo)){
        c.log('No recibimos un arreglo de urls');
        c.log(' --- Se termina funcin de clicToCallShow --- ');
        return false;
    } else {
        l = arreglo.length;
        c.log('Posicion actual: ' + posicion);
        for (i; i < l; i++) {
            c.log('La url ' + i + ': ' + arreglo[i]);
            if(posicion != arreglo[i]) {
                // Si no viene en el arreglo de urls, el botn rojo aparecer
                boton.addClass('mostrar');
            } else {
                if(contenedorForm.length && ancho>600) {
                    c.log('Clonamos el formulario');
                    formulario.prependTo(contenedorForm).fadeIn();
                    //contenedorForm.find('#c2cp').addClass('ignore');
                } else {
                    c.log('Falta crear el contenedor del formulario o no hay espacio en la ventana para mostrarlo');
                }
                boton.removeClass('mostrar');
                break;
            }
        }
        c.log(' --- Se termina funcin de clicToCallShow --- ');
    }
    
}

